import '../../../node_modules/augmented-ui/augmented-ui.min.css';
import './head.css';
import HeadTop from './head-top/head-top';
import BannerVideo from './banner-video/banner-video';
import SocialMedia from './social-media/';

function Head() {

    return (
        <div className='head'>
            <HeadTop/>
            <BannerVideo/>
            <SocialMedia/>            
        </div>
    )
}
export default Head;
